import React from "react";
import PropTypes from "prop-types";
import "./style.scss";

Home.propTypes = {};

function Home(props) {
  return (
    <div className="home">
      <form className="home__form">
        <i class="fa fa-user" aria-hidden="true"></i>
        <input placeholder="Email" className="home__input"></input>
        <i class="fa fa-key" aria-hidden="true"></i>

        <input placeholder="Password" className="home__input"></input>
        <button className="home__btn">Login</button>
      </form>
    </div>
  );
}

export default Home;
